import{_ as a,a as r,b as e}from"./chunks/smartap-pdb-current-sensor.CnjfqaEk.js";import{_ as t,c as l,o as i,ab as o}from"./chunks/framework.CUflZczI.js";const f=JSON.parse('{"title":"Sky-Drones SmartAP GPS","description":"","frontmatter":{},"headers":[],"relativePath":"uk/power_module/sky-drones_smartap-pdb.md","filePath":"uk/power_module/sky-drones_smartap-pdb.md"}'),s={name:"uk/power_module/sky-drones_smartap-pdb.md"},p=o('<h1 id="sky-drones-smartap-gps" tabindex="-1">Sky-Drones SmartAP GPS <a class="header-anchor" href="#sky-drones-smartap-gps" aria-label="Permalink to &quot;Sky-Drones SmartAP GPS&quot;">​</a></h1><p><a href="https://sky-drones.com/power/smartap-pdb.html" target="_blank" rel="noreferrer">SmartAP PDB</a> (розподільча плата живлення) використовується для спрощення розподілу живлення від однієї або декількох батарей до ESC (двигунів), керуючого пристрою польоту та інших периферійних пристроїв. Вона також виступає як <a href="./../power_module/">блок живлення</a>, що дозволяє вимірювати напругу батареї та поточний струм. SmartAP PDB спрощує підключення високовольтних ліній, роблячи їх надійнішими та зручнішими.</p><p><img src="'+a+'" alt="SmartAP PDB"></p><h2 id="специфікаціі" tabindex="-1">Специфікації <a class="header-anchor" href="#специфікаціі" aria-label="Permalink to &quot;Специфікації&quot;">​</a></h2><ul><li>Розмір: 65*65 мм, 4х М3 кріплення отворів</li><li>Напруга введення до 60 Вольт (14S)</li><li>Можливість керування екстремально високими струмами (максимальний струм до 400A)</li><li>Живлення від основного акумулятора, можливість підключення до 2 незалежних акумуляторів</li><li>12 пар клем (6 зверху, 6 знизу) для живлення до 12 двигунів</li><li>Інтегровані датчики напруги та струму з фільтрами L/C</li><li>Точні виміри струму на основі ефекту Холла</li><li>Інтегрований DC-DC перетворювач від входу 10-60 В (до 14S акумулятора) до виходу 5 В / 5A для живлення периферійних пристроїв</li><li>Інтегрований DC-DC перетворювач від входу 10-60 В (до 14S акумулятора) до виходу 12 В / 5A для живлення периферійних пристроїв</li><li>Вихідні клеми живлення 5 В і 12 В (стандартні коннектори 2.54 мм / 0,1 дюйма)</li><li>Інтегрований електромагнітний сигналізатор (сигналізація)</li><li>Вихід живлення для керуючого пристрою польоту (як 5 В регульоване, так і вихід на рівні напруги акумулятора)</li></ul><h2 id="розмір-і-вага" tabindex="-1">Розмір і вага <a class="header-anchor" href="#розмір-і-вага" aria-label="Permalink to &quot;Розмір і вага&quot;">​</a></h2><ul><li>Довжина: 65мм</li><li>Ширина: 65мм</li><li>Висота: 14мм</li><li>Вага: 8g</li></ul><h2 id="налаштування-px4" tabindex="-1">Налаштування PX4 <a class="header-anchor" href="#налаштування-px4" aria-label="Permalink to &quot;Налаштування PX4&quot;">​</a></h2><p><a href="./../config/battery.html">Налаштування оцінювання батареї</a> описує як налаштувати налаштування батареї для модуля живлення.</p><p>Етапи конфігурації ключових налаштувань:</p><ul><li>Подільник напруги: 15.51</li><li>Ампери на вольт: 36.00</li></ul><h2 id="де-купити" tabindex="-1">Де купити <a class="header-anchor" href="#де-купити" aria-label="Permalink to &quot;Де купити&quot;">​</a></h2><p><a href="https://sky-drones.com/parts/smartap-pdb.html" target="_blank" rel="noreferrer">SmartAP PDB</a></p><h2 id="проводка-схема-роз-ємів" tabindex="-1">Проводка / Схема роз&#39;ємів <a class="header-anchor" href="#проводка-схема-роз-ємів" aria-label="Permalink to &quot;Проводка / Схема роз&#39;ємів&quot;">​</a></h2><p>На відповідній схемі роз&#39;ємів плати розподілу потужності SmartAP показано нижче.</p><p><img src="'+r+'" alt="SmartAP PDB"></p><p>Два великих контактних пункти призначені для підключення основного акумулятора. Для здатності витримувати великі струми та вищу загальну ємність можна підключити до двох незалежних акумуляторів за допомогою товстих проводів (наприклад, 8-10 AWG). До 12 ESC можна підключити за допомогою 6 менших контактних пунктів у верхній, нижній, лівій та правій частині.</p><h2 id="датчики-напруги-та-струму" tabindex="-1">Датчики напруги та струму <a class="header-anchor" href="#датчики-напруги-та-струму" aria-label="Permalink to &quot;Датчики напруги та струму&quot;">​</a></h2><p>У SmartAP PDB вбудовані датчики напруги та струму. Датчик струму розташований на нижній стороні плати розподілу потужності.</p><p><img src="'+e+'" alt="SmartAP PDB"></p><h2 id="подальша-інформація" tabindex="-1">Подальша інформація <a class="header-anchor" href="#подальша-інформація" aria-label="Permalink to &quot;Подальша інформація&quot;">​</a></h2><ul><li><a href="https://sky-drones.com/power/smartap-pdb.html" target="_blank" rel="noreferrer">Купити SmartAP PDB</a></li><li><a href="https://docs.sky-drones.com/avionics/smartap-pdb" target="_blank" rel="noreferrer">Документація</a></li></ul>',22),n=[p];function h(d,m,_,c,P,u){return i(),l("div",null,n)}const S=t(s,[["render",h]]);export{f as __pageData,S as default};
